def shortest_path_on_square(n, x1, y1, x2, y2):

    def get_side(x, y):
        if y == 0:
            return 4
        elif y == n:
            return 2
        elif x == 0:
            return 1
        elif x == n:
            return 3
    first = get_side(x1, y1)
    secnd = get_side(x2, y2)
    if first == 4 or secnd == 1:
        pass
    elif first > secnd or (first == 1 and secnd == 4):
        (x1, x2) = (x2, x1)
        (y1, y2) = (y2, y1)
        (first, secnd) = (secnd, first)
    if abs(first - secnd) == 1 or first + secnd == 5:
        if first == 1:
            rast = n - y1 + x2
        elif first == 3:
            rast = y1 + n - x2
        elif first == 2:
            rast = n - x1 + n - y2
        else:
            rast = x1 + y2
    elif first == secnd:
        if first == 2 or first == 4:
            rast = abs(x1 - x2)
        else:
            rast = abs(y1 - y2)
    elif first == 1:
        rast = min(y1 + n + y2, n - y1 + n - y2 + n)
    else:
        rast = min(x1 + n + x2, n - x1 + n - x2 + n)
    return rast

